import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Wait for the featured products grid to appear
    await page.waitForSelector('#productsGrid .product-card', { timeout: 5000 });

    // 2. Click the first product card to open the product detail modal
    const firstProductCard = await page.$('#productsGrid .product-card');
    await firstProductCard.click();

    // 3. Wait for the product detail modal to appear
    await page.waitForSelector('#productModal', { timeout: 5000 });
    await page.waitForSelector('#productModal .add-to-wishlist', { timeout: 5000 });

    // Take screenshot of product detail modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_product_detail_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_product_detail_modal.png'));

    // 4. Click the "Add to Wish List" button inside the modal
    const addToWishlistBtn = await page.$('#productModal .add-to-wishlist');
    await addToWishlistBtn.click();

    // 5. Wait for the notification to appear
    await page.waitForSelector('.notification.success', { timeout: 5000 });

    // Take screenshot after adding to wishlist
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_added_to_wishlist.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_added_to_wishlist.png'));

    // 6. Close the product modal by clicking the close button (span.close)
    const closeBtn = await page.$('#productModal .close');
    if (closeBtn) {
      await closeBtn.click();
      // Wait for modal to disappear
      await page.waitForSelector('#productModal', { state: 'hidden', timeout: 5000 });
    }

    // 7. Navigate to the wishlist page
    // Try to find the "Your Wish List" link by text (first visible occurrence)
    const wishlistLink = await page.$('a:text("Your Wish List")');
    if (wishlistLink) {
      await wishlistLink.click();
    } else {
      // fallback: try another selector if needed
      throw new Error('Could not find "Your Wish List" link');
    }

    // 8. Wait for the wishlist page to load
    await page.waitForSelector('.wishlist-page', { timeout: 5000 });
    await page.waitForSelector('.wishlist-item', { timeout: 5000 });

    // Take screenshot of wishlist page
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_wishlist_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_wishlist_page.png'));

    // 9. Extract the title of the first wishlist item for verification
    const wishlistTitle = await page.$eval('.wishlist-item .wishlist-title', el => el.textContent.trim());

    return {
      success: true,
      action: "Added first product to wishlist and verified it appears in the wishlist page",
      extractedData: {
        wishlistFirstItemTitle: wishlistTitle
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
